/** Escape for use inside HTML text/content. */
function escapeHtml(s) {
  if (s == null) return "";
  return String(s)
    .replace(/&/g, "&amp;")
    .replace(/</g, "&lt;")
    .replace(/>/g, "&gt;")
    .replace(/"/g, "&quot;");
}

/** If description is short (no Example/Constraints blocks), append Examples and Constraints from test cases so all descriptions are long-format. */
function ensureLongDescription(problem) {
  const content = problem.content || "";
  const hasExamples = /<strong>Example\s*\d*:?\s*<\/strong>|Example\s+1:/i.test(content);
  const hasConstraints = /<strong>Constraints:?\s*<\/strong>|Constraints:?\s*<\/p>/i.test(content);
  if (hasExamples && hasConstraints) return problem;

  const parts = [content.trim()];
  if (!hasExamples && Array.isArray(problem.testCases) && problem.testCases.length > 0) {
    parts.push("<p><strong>Examples:</strong></p>");
    problem.testCases.slice(0, 4).forEach((tc, i) => {
      const input = tc.stdin != null ? escapeHtml(String(tc.stdin)) : "";
      const output = tc.expected != null ? escapeHtml(String(tc.expected)) : "";
      parts.push(`<p><strong>Example ${i + 1}:</strong></p><pre>Input:\n${input}\nOutput: ${output}</pre>`);
    });
  }
  if (!hasConstraints) {
    parts.push("<p><strong>Constraints:</strong></p><ul><li>See examples above for valid input ranges and format.</li></ul>");
  }
  return { ...problem, content: parts.join("\n") };
}

export function getBuiltinProblem(slug) {
  if (slug == null || !String(slug).startsWith(BUILTIN_PREFIX)) return null;
  const p = problems.find((q) => q.titleSlug === slug);
  if (!p) return null;
  const withLongDesc = ensureLongDescription(p);
  // Serve stub-only snippets (no full solutions) so the editor shows templates with correct indentation.
  const stubs = makeStubSnippets(withLongDesc.metaData);
  return stubs.length > 0 ? { ...withLongDesc, codeSnippets: stubs } : withLongDesc;
}

export function listBuiltinProblems() {
  return problems.map((p) => ({
    title: p.title,
    titleSlug: p.titleSlug,
    difficulty: p.difficulty,
  }));
}

export function pickBuiltinQuestion(difficulty) {
  const filtered = difficulty
    ? problems.filter((q) => q.difficulty.toLowerCase() === String(difficulty).toLowerCase())
    : problems;
  if (filtered.length === 0) return null;
  return filtered[Math.floor(Math.random() * filtered.length)];
}

export function getBuiltinTestCases(slug) {
  const p = getBuiltinProblem(slug);
  return p && Array.isArray(p.testCases) ? p.testCases : [];
}
